import { Link } from 'react-router-dom';

function ArtDescription({ gallery, object }) {
    <div>
        <Link to={`/galleries/${gallery.galleryNumber}`}>
            {`Back to the ${gallery.name} Gallery`}
        </Link>

        <Link to={object.url}>
            <h2>{object.title}</h2>
        </Link>

        {
            object.images.map((image) => {
                return (
                    <img
                        src={image.baseimageurl}
                        alt='art from harvard art museum'>
                    </img>
                )
            })
        }
        <p>object.description</p>
        <p>object.creditline</p>
        <p>object.technique</p>
    </div >
}

export default ArtDescription;
